判断计算属性key是否与props/data命名冲突，目的是此处会在vm上创建一个以计算属性名称一致的字段，用以保存计算属性计算值（快照）。第一次计算属性计算完成之后，不发生改变的情况下，之后的renderWatcher渲染时候都从此处取值，不会从新调用计算属性函数计算结果。

